import { Container, Line, GithubLogo, HomeLogo } from './styles';

const Footer: React.FC = () => {
  return (
    <Container>

    <div className="Nav">

        <HomeLogo />
        <p>Home</p>




        <GithubLogo />
        <p>Repos</p>
      </div>

    </Container>
  );
};

export default Footer;
